import VehiclesEdit from "./edit/VehiclesEdit.js";
import VehiclesDefault from "./default/VehiclesDefault.js";
export default {
  props: {
    vehicles: {
      type: Array,
      required: true
    },
    route: {
      type: String,
      required: true
    },
    editableVehicle: {
      type: Object,
      required: true
    },
    shortRanks: {
      type: Array,
      required: true
    }
  },
  render(h) {
    if (this.route === 'vehicles/edit') {
      return h(VehiclesEdit, {
        key: 'vehicles/edit',
        props: {
          editableVehicle: this.editableVehicle,
          shortRanks: this.shortRanks
        }
      });
    } else {
      return h(VehiclesDefault, {
        key: 'vehicles',
        props: {
          vehicles: this.vehicles
        }
      });
    }
  }
};

